import React, {useState} from 'react';

const UseEffect = () => {
    const [sum, setsum] = useState(0);

    
    return(
        <>
        <h1>Pooja Agrawal</h1>
        <button onClick = {() => { setsum(sum+1)} , () => {
            alert("I am clicked")
        }}>Click me {sum}</button>
        </>
    )

}

export default UseEffect;
